import s from './header.module.css'

const Header = () => {
    return (
        <header className={s.header}>
            <img src="https://www.pinclipart.com/picdir/big/540-5400645_logo-tiger-png-hd-clipart.png" alt={'Lion'}/>
            <h3>ArysBoook</h3>
        </header>
    );
};

export default Header;
